INSERT INTO projects (project_id, name, url, description, project_type_id, is_private, is_enabled, storage_usage, processing_usage, pattern_matching_enabled, citizen_scientist_enabled, cnn_enabled, aed_enabled, clustering_enabled, external_id, featured, deleted_at, image, reports_enabled, country, state, created_at, updated_at, is_partner) VALUES (1060, 'USFWS_Carite_warbler', 'usfws-carite-warbler', 'In this project Sieve Analytics will conduct field research focusing on understanding the distribution the Elfin Woods Warbler (Dendroica angelae) in Carite and El Yunque.  The service will include: 1) providing recording devices, 2) field sampling of 60 sites in Carite and 60 sites in El Yunque, 3) processing and storage of recordings, and 4) analyses and interpretation of the recordings.', 1, 0, 1, 0, 0, 1, 1, 1, 1, 1, '807cuoi3cvw2', 1, null, 'https://static.rfcx.org/arbimon/0002.jpg', 1, null, null, '2022-06-23 20:58:27.0', '2023-01-23 08:32:50.0', 0);
